import React, { Component } from 'react'

class MobileOS extends Component {
  render(){
    return (
      <div>
        <h1>Mobile Operating System</h1>
        <ul>
            <li>Android</li><li>Blackberry</li><li>iPhone</li><li>Windows Phone</li></ul>
      </div>
    )
  }
}

export default MobileOS
